description:
&quot;Bob loves Carol. Carol dies. Bob is left to raise his estranged teenage daughter Dana, who he doesn't know how to talk to. Dana turns 18 and Bob decides to make a nice party for her. He orders a cake from a young girl named Gladys who brings it to his house. When it turns out that Gladys is actually Carol reincarnated, bob finds both the love he's been longing to return to and a way to get his daughter to believe in life again. But how long will Carol's return last? Time enough to heal all the wounds left behind in her wake.&quot;

Ana Foxxx, AJ Applegate, Abby Cross, Devon, Bruce Ventura, Billy Glide, Tommy Pistol.

